import logo from "./logo.svg";
import "./App.css";
import Login from "./components/Login";
import { Route, Router, Routes } from "react-router-dom";
import GameForm from "./components/GameForm";

function App() {
	return (
		<Router>
			<div className="App">
				<Routes>
					<Route
						exact
						path="/"
						component={Login}
					/>
					<Route
						path="/create-game"
						component={GameForm}
					/>
					<Route
						path="/game-list"
						component={GameList}
					/>
				</Routes>
				<Login />
			</div>
		</Router>
	);
}

export default App;
